					foreach($mainVal as $key=>$val){
						
						$_Asegments = $val['Segments'];
						
						foreach($_Asegments as $segmentKey=>$segmentVal){
							
							foreach($segmentVal as $segmentSubKey=>$segmentSubVal){
								
