									$_AnewFlights[0][0] = $val;
									$_BflightSet = true;
								}
							}
							
						}
						
					}
				}
				$_AflightResults = $_AnewFlights;
			}
			
			if(count($_AflightResults) > 0){
				
				$_SfareType = 'S';
				
