						$_Srefundable 		= ($val['IsRefundable'] == true) ? "Y" : "N";
						$_SresultIndex 		= $val['ResultIndex'];
						$_SflightMergeKey	= $_SresultIndex;
						
						if($_SfareType == 'M'){
