							unset($_ApriceRbdVal['Segments']);
							unset($_ApriceRbdVal['LastTicketDate']);
							unset($_ApriceRbdVal['TicketAdvisory']);
							unset($_ApriceRbdVal['AirlineCode']);
							unset($_ApriceRbdVal['ValidatingAirline']);
