								$tmpDepartureDate 	= $stdExplode[0];
								$tmpDepartureTime 	= substr($stdExplode[1],0,5);
								
								$viaFlights[$segmentSubKey]['departureDate'] 	= $tmpDepartureDate;
								$viaFlights[$segmentSubKey]['departureTime'] 	= substr($stdExplode[1],0,5);
								
